import React from "react";
import {Link} from 'react-router-dom';
import { BrowserRouter as Router, Route,Routes } from "react-router-dom";
import  Form from "react-bootstrap";

class Registration extends React.Component{

    constructor(props){
        super(props);
        this.state= this.initiaLSTATE;
    }

    initiaLSTATE={
        id:"",
        name:"",
        email:"",
        username:"",
        password:"",
        confirmpassword:"",
        pnumber:"",

    };
    handlesubmit() {
       
        alert("saved ")
        this.state= this.initiaLSTATE;

    }
    render(){

        
        return(
        <Form>
            <div className="main">
            <div >
              <div>
                <div>
                  <h1>Registartion Page</h1>
                  <div>
                    
                    <input type="text" placeholder="name" className="name" name="name" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="email" placeholder="Email" className="name" name="email" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Username" className="name"  name="username" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="password" placeholder="Password" className="name" name="password" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="password" placeholder=" Confirm Password" className="name" name="confirmpassword" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Specialization" className="name"required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="Number" placeholder="Phone number" className="name" name="pnumber"required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Avaliability" className="name" required/>
                  </div>
                  
                 <div className="login-button">
                 <button  >submit</button>
                 </div>
                </div>
              </div>
              
       
            </div>
           </div> 
           </Form>
        );
    }
}

export default Registration;
